const Text = (props) =>{
    const {textInput,type} = props;
    
    console.log(props);
    return (
        <>
        {(() => {
        switch (type) {
          case 'h1':
            <h1  >{textInput}</h1>
            break;
          case 'h2':
            <h2 >{textInput}</h2>
            break;
          
          default:
            <p>{textInput}</p>
            break;
        }
      })()}        
        </>
    )

}

export default Text
